      '#alexi_thinking\n‚†Ä\n–ü–æ–∂–∞–ª—É–π—Å—Ç–∞, –¥–∞–π –º–Ω–µ —à–∞–Ω—Å!\n‚†Ä\n–Ø –∑–Ω–∞—é, –ø–æ—Ä–æ–π –∑–∞—Å—Ç–∞–≤–∏—Ç—å —Å–µ–±—è –≤—ã–ª–µ–∑—Ç–∏  –∏–∑-–ø–æ–¥ –æ–¥–µ—è–ª–∞ —Ç—Ä—É–¥–Ω–æ. –ù–∞–º –∏ –∂–∏—Ç—å —Ç–æ –ª–µ–Ω—å, –æ —á–µ–º —Ä–µ—á—å. –ù–æ –ª–µ–Ω—å ‚Äì –∂–µ–Ω—â–∏–Ω–∞ –Ω–µ–æ–¥–∏–Ω–æ–∫–∞—è. –û–Ω–∞ –ø—Ä–∏—Ö–æ–¥–∏—Ç –≤ –ø–∞—Ä–µ —Å–æ —Å—Ç—Ä–∞—Ö–æ–º –∏ –µ–≥–æ –ø–æ—Å–ª–µ–¥–æ–≤–∞—Ç–µ–ª–µ–º ‚Äì –¥–∏—Å–∫–æ–º—Ñ–æ—Ä—Ç–æ–º.  –ü—Ä–æ—Å—Ç–æ —Å–º–∏—Ä–∏—Ç–µ—Å—å, –ø—É–≥–∞—Ç—å—Å—è –Ω–µ–∑–Ω–∞–∫–æ–º—ã—Ö –≤–µ—â–µ–π ‚Äì –Ω–æ—Ä–º–∞–ª—å–Ω–æ.\n‚†Ä\n–í–ø–µ—Ä–≤—ã–µ –ø—Ä–∏–π—Ç–∏ –Ω–∞ –ª–µ–∫—Ü–∏—é, —è–∑—ã–∫–æ–≤—ã–µ –∫—É—Ä—Å—ã –∏–ª–∏ –≤—Å—Ç—É–ø–∏—Ç—å –≤ –∫–∞–∫–æ–π-—Ç–æ –∫–ª—É–± - –∏–Ω–æ–≥–¥–∞ –Ω–µ–ø–æ—Å–∏–ª—å–Ω–∞—è —ç–º–æ—Ü–∏–æ–Ω–∞–ª—å–Ω–∞—è –∑–∞–¥–∞—á–∞. –°–æ–º–Ω–µ–Ω–∏—è —Ä–∞–∑—Ä–∞—Å—Ç–∞—é—Ç—Å—è –∫–∞–∫ –≥—Ä–∏–±—ã –∏ –ø–æ—Ä–∞–∂–∞—é—Ç –≤–∞—Å —Å–ª–æ–≤–Ω–æ —á—É–º–∞.\n‚†Ä\n¬´–ß—Ç–æ, –µ—Å–ª–∏ —ç—Ç–æ –ø—É—Å—Ç–∞—è —Ç—Ä–∞—Ç–∞ –≤—Ä–µ–º–µ–Ω–∏?¬ª - —à–µ–ø—á–µ—Ç —É—Ä–æ–¥–ª–∏–≤–∞—è —Å—Ç–∞—Ä—É—Ö–∞ –≤–Ω—É—Ç—Ä–∏ –≤–∞—Å. –ê –≤ —ç—Ç–æ –≤—Ä–µ–º—è —Ä–æ–¥–Ω—ã–µ —Å—Ç–µ–Ω—ã –¥–æ–º–∞ –º–∞–Ω—è—Ç –∏ –∑–æ–≤—É—Ç —É–∫—Ä—ã—Ç—å—Å—è –æ—Ç —Ö–∞–æ—Å–∞ –∏ —Å—É–µ—Ç—ã –≤–Ω–µ—à–Ω–µ–≥–æ –º–∏—Ä–∞.\n‚†Ä\n–ù–æ –≤—ã –≤–µ–¥—å –Ω–µ —á–∏—Ç–∞–µ—Ç–µ —Ç–æ–ª—å–∫–æ –∫–Ω–∏–≥–∏ –ë—É–ª–≥–∞–∫–æ–≤–∞, –ø–æ—Ç–æ–º—É —á—Ç–æ –æ–¥–Ω–∞–∂–¥—ã –æ–Ω–∏ –≤–∞–º –ø–æ–Ω—Ä–∞–≤–∏–ª–∏—Å—å. –î–∞, –¥—Ä—É–≥–∏–µ –º–æ–≥—É—Ç –æ–∫–∞–∑–∞—Ç—å—Å—è –Ω–µ —Ç–∞–∫–∏–º–∏ –∫–ª–∞—Å—Å–Ω—ã–º–∏ –∏ –≤–æ–æ–±—â–µ –ø—É—Å—Ç–æ–π —Ç—Ä–∞—Ç–æ–π –≤—Ä–µ–º–µ–Ω–∏, –Ω–æ...\n‚†Ä\n...—á—Ç–æ, –µ—Å–ª–∏ –≤—ã –Ω–∞–π–¥–µ—Ç–µ –∫–Ω–∏–≥–∏ –û—Å–∫–∞—Ä–∞ –£–∞–π–ª–¥–∞?\n‚†Ä\n–¢–∞–∫ –∏ –≤ –∂–∏–∑–Ω–∏. –î–µ–Ω—å –∑–∞ –¥–Ω–µ–º, –≤—ã–ø–æ–ª–Ω—è—è –æ–¥–Ω–∏ –∏ —Ç–µ –∂–µ –¥–µ–π—Å—Ç–≤–∏—è, –Ω–µ –∂–¥–∏—Ç–µ —Ä–∞–∑–Ω—ã—Ö —Ä–µ–∑—É–ª—å—Ç–∞—Ç–æ–≤. –ö–∞–∂–¥—ã–π –¥–µ–Ω—å, –Ω–∞—Å—ã–ø–∞—è –≤ –∫—Ä—É–∂–∫—É –ø–æ—Ä–æ—à–æ–∫ –∏–∑ –±–∞–Ω–∫–∏ –∫–æ—Ñ–µ, –≤—ã –∂–µ –Ω–µ –æ–∂–∏–¥–∞–µ—Ç–µ –Ω–∞ –≤—ã—Ö–æ–¥–µ –ø–æ–ª—É—á–∏—Ç—å –ª–∏–º–æ–Ω–∞–¥. –ö–æ–≥–¥–∞ —Å–æ–≥–ª–∞—à–∞–µ—Ç–µ—Å—å —Å–¥–µ–ª–∞—Ç—å —Ç–æ, —á–µ–≥–æ —Ä–∞–Ω—å—à–µ –Ω–µ –¥–µ–ª–∞–ª–∏, –∏ —Å–æ–º–Ω–µ–≤–∞–µ—Ç–µ—Å—å, —á—Ç–æ –≤–∞–º —ç—Ç–æ –ø–æ–Ω—Ä–∞–≤–∏—Ç—Å—è, –≤–æ—Å–ø—Ä–∏–Ω–∏–º–∞–π—Ç–µ —ç—Ç–æ –∫–∞–∫ –Ω–æ–≤—ã–π —Ñ–∏–ª—å–º –∏–ª–∏ –∫–Ω–∏–≥—É. –ï—Å–ª–∏ –≤–∞–º —á—Ç–æ-—Ç–æ –Ω—Ä–∞–≤–∏—Ç—Å—è, —ç—Ç–æ –Ω–µ –∑–Ω–∞—á–∏—Ç, —á—Ç–æ –≤ –º–∏—Ä–µ –±–æ–ª—å—à–µ –Ω–µ—Ç —Ö–æ—Ä–æ—à–µ–π –ª–∏—Ç–µ—Ä–∞—Ç—É—Ä—ã.\n‚†Ä\n–í –≥–ª—É–±–∏–Ω–µ –¥—É—à–∏ –±–æ–ª—å—à–µ –≤—Å–µ–≥–æ –º—ã –±–æ–∏–º—Å—è –Ω–µ —Ç–æ–≥–æ, —á—Ç–æ –Ω–∞–º —á—Ç–æ-—Ç–æ –ø—Ä–∏–¥–µ—Ç—Å—è –Ω–µ –ø–æ –¥—É—à–µ. –ù–∞–æ–±–æ—Ä–æ—Ç. –ú—ã –±–æ–∏–º—Å—è, —á—Ç–æ –Ω–∞–º —á—Ç–æ-—Ç–æ –ø–æ–Ω—Ä–∞–≤–∏—Ç—Å—è. –ê –µ—â–µ —Ö—É–∂–µ, —á—Ç–æ –ø–æ–π–º–µ–º: –≤—Å–µ –ø—Ä–æ—à–µ–¥—à–∏–µ –≥–æ–¥—ã –±–µ–∑ —ç—Ç–æ–≥–æ –º–µ—Å—Ç–∞, –∑–∞–Ω—è—Ç–∏—è –∏–ª–∏ —á–µ–ª–æ–≤–µ–∫–∞ –ë–´–õ–ò –ü–£–°–¢–û–ô –¢–†–ê–¢–û–ô –í–†–ï–ú–ï–ù–ò.\n‚†Ä\n–¢–∞–∫ –ª–µ–≥–∫–æ –∂–∏—Ç—å –≤ —Å–≤–æ–µ–º –º–∞–ª–µ–Ω—å–∫–æ–º –≤—ã–¥—É–º–∞–Ω–Ω–æ–º –º–∏—Ä–∫–µ, –≥–¥–µ –≤—Å—è –∏–ª–ª—é–∑–∏—è –ø–æ–ª–µ–∑–Ω–æ—Å—Ç–∏ –ø–æ—Ç—Ä–∞—á–µ–Ω–Ω—ã—Ö –ø—Ä–µ–∂–¥–µ —á–∞—Å–æ–≤ - —ç—Ç–æ –∫–æ–Ω—Å—Ç–∞–Ω—Ç–∞.\n‚†Ä\n–ü–æ—ç—Ç–æ–º—É –¥–∞–π—Ç–µ —à–∞–Ω—Å –≤—Å–µ–º—É. –î–ª—è —ç—Ç–æ–≥–æ –Ω–µ –Ω—É–∂–Ω–æ –±—Ä–æ—Å–∞—Ç—å –ø—Ä–∏–≤—ã—á–Ω–æ–µ. –ü—Ä–æ—Å—Ç–æ –Ω–µ –≥–æ–≤–æ—Ä–∏—Ç–µ ¬´–ù–ï–¢¬ª —Å–≤–æ–º–∏ –≤–æ–∑–º–æ–∂–Ω–æ—Å—Ç—è–º. –ù–µ –æ—Ç–∫–∞–∑—ã–≤–∞–π—Ç–µ—Å—å –æ—Ç –Ω–æ–≤—ã—Ö –º–∞—Ä—à—Ä—É—Ç–æ–≤.\n‚†Ä\n–ü–æ—Ä–æ–π –∫–∞–∂–¥–æ–º—É –∏–∑ –Ω–∞—Å –Ω–µ –ø–æ–º–µ—à–∞–µ—Ç –±—ã—Ç—å –ø–µ—Ä—Å–æ–Ω–∞–∂–µ–º –î–∂–∏–º–∞ –ö–µ—Ä—Ä–∏ –∏–∑ —Ñ–∏–ª—å–º–∞ "–í—Å–µ–≥–¥–∞ –≥–æ–≤–æ—Ä–∏ "–¥–∞". –ê –≤–¥—Ä—É–≥ –ø–æ–Ω—Ä–∞–≤–∏—Ç—Å—è?',
      '–ù—É –≤—Å–µ —É–∂–µ –ø–æ—Å–ª–µ–¥–Ω—è—è, –æ–±–µ—â–∞—éü§¶üèΩ\u200d‚ôÄÔ∏è. –†–µ–±—è—Ç, –µ—Å–ª–∏ –∏–Ω—Å—Ç–∞–≥—Ä–∞–º —É–º—Ä–µ—Ç, —á—Ç–æ –±—É–¥–µ–º –¥–µ–ª–∞—Ç—å? –ò –∫–∞–∫ –¥—É–º–∞–µ—Ç–µ, —á—Ç–æ —Å –Ω–∏–º —Å–ª—É—á–∏—Ç—Å—è –≤ –±—É–¥—É—â–µ–º? \n–Ø —á–∞—Å—Ç–æ —Å–ª—ã—à—É –∫–∞–∫–∏–µ-—Ç–æ –Ω–µ–≥–∞—Ç–∏–≤–Ω—ã–µ –æ—Ç–∑—ã–≤—ã –æ–± –æ–ø—ã—Ç–µ –≤ –ò–Ω—Å—Ç–∞–≥—Ä–∞–º. –î–µ–≤–æ—á–∫–∏ —á–∞—Å—Ç–æ –≥–æ–≤–æ—Ä—è—Ç, —á—Ç–æ –≤ –ò–Ω—Å—Ç–∞–≥—Ä–∞–º–µ —É –≤—Å–µ—Ö –≤—Å–µ —Ç–∞–∫ –∫—Ä—É—Ç–æ, —á—Ç–æ —ç—Ç–æ –∏—Ö —Å–º—É—â–∞–µ—Ç –∏ –æ–Ω–∏ —á—É–≤—Å—Ç–≤—É—é—Ç —Å–µ–±—è –Ω–µ—É–≤–µ—Ä–µ–Ω–Ω–æ. –ù—É –Ω–µ –∑–Ω–∞—é, —É –º–µ–Ω—è –≤ –ò–≥ –∏—Å–∫–ª—é—á–∏—Ç–µ–ª—å–Ω–æ –ø–æ–∑–∏—Ç–∏–≤–Ω—ã–π –æ–ø—ã—Ç. –ú–µ–Ω—è –æ—á–µ–Ω—å –≤–¥–æ—Ö–Ω–æ–≤–ª—è—é—Ç –∫—Ä–∞—Å–∏–≤—ã–µ –∫–∞—Ä—Ç–∏–Ω–∫–∏, –∫—Ä–∞—Å–∏–≤–∞—è –∂–∏–∑–Ω—å, –ª—é–¥–∏, –≤–µ—â–∏, –∏–¥–µ–∏, –º–µ—á—Ç—ã. –•–æ—á–µ—Ç—Å—è —Ä–∞–±–æ—Ç–∞—Ç—å –µ—â—ë –±–æ–ª—å—à–µ, —Å—Ç–∞—Ä–∞—Ç—å—Å—è —Å–æ —Å–≤–æ–∏–º–∏ —Å—Ç—Ä–∞—Ö–∞–º–∏ –µ—â—ë –±–æ–ª—å—à–µ, –µ—â—ë –±–æ–ª—å—à–µ –º–µ—á—Ç–∞—Ç—å. –£ –º–µ–Ω—è, –∫—Å—Ç–∞—Ç–∏, –ø–æ –∫–≤–∞–¥—Ä–∞—Ç—É –ü–∏—Ñ–∞–≥–æ—Ä–∞ —Å–µ–∫—Ç–æ—Ä –ª–æ–≥–∏–∫–∞ –ø—É—Å—Ç—É–µ—ÇüòÇ, —ç—Ç–æ –∑–Ω–∞—á–∏—Ç, —á—Ç–æ —è —á–µ–ª–æ–≤–µ–∫ —Å –±–µ–∑–≥—Ä–∞–Ω–∏—á–Ω–æ–π —Ñ–∞–Ω—Ç–∞–∑–∏–µ–π. –≠—Ç–æ –ø—Ä–∞–≤–¥–∞, —è —Ä–µ–∞–ª—å–Ω–æ –º–æ–≥—É –ø—Ä–æ—Å—Ç–æ –∂–∏—Ç—å –≤ –º–∏—Ä–µ, –∫–æ—Ç–æ—Ä—ã–π —É –º–µ–Ω—è –≤ –≥–æ–ª–æ–≤–µ. –≠—Ç–æ –º–æ–∂–µ—Ç –±—ã—Ç—å –æ–ø–∞—Å–Ω–æ, –µ—Å–ª–∏ –Ω–µ –Ω–∞—É—á–∏—Ç—å—Å—è –∑–∞–∑–µ–º–ª—è—Ç—å—Å—è, –º–æ–≥—É –ø—Ä–æ—Å—Ç–æ –æ—Ç—Å—É—Ç—Å—Ç–≤–æ–≤–∞—Ç—å –≤ —ç—Ç–æ–º –º–∏—Ä–µ –Ω–µ–¥–µ–ª—è–º–∏, —Ö–æ–¥–∏—Ç—å –ø–æ –≥–æ—Ä–æ–¥—É, —á—Ç–æ-—Ç–æ –¥–µ–ª–∞—Ç—å, –≥—É–ª—è—Ç—å, –Ω–æ –Ω–∞ —Å–∞–º–æ–º –¥–µ–ª–µ —è –Ω–µ —Ç—É—ÇüôÜüèΩ\u200d‚ôÄÔ∏è.',
