                                       '–ù—É –≤—Å–µ —É–∂–µ –ø–æ—Å–ª–µ–¥–Ω—è—è, –æ–±–µ—â–∞—éü§¶üèΩ\u200d‚ôÄÔ∏è. –†–µ–±—è—Ç, –µ—Å–ª–∏ –∏–Ω—Å—Ç–∞–≥—Ä–∞–º —É–º—Ä–µ—Ç, —á—Ç–æ –±—É–¥–µ–º –¥–µ–ª–∞—Ç—å? –ò –∫–∞–∫ –¥—É–º–∞–µ—Ç–µ, —á—Ç–æ —Å –Ω–∏–º —Å–ª—É—á–∏—Ç—Å—è –≤ –±—É–¥—É—â–µ–º? \n–Ø —á–∞—Å—Ç–æ —Å–ª—ã—à—É –∫–∞–∫–∏–µ-—Ç–æ –Ω–µ–≥–∞—Ç–∏–≤–Ω—ã–µ –æ—Ç–∑—ã–≤—ã –æ–± –æ–ø—ã—Ç–µ –≤ –ò–Ω—Å—Ç–∞–≥—Ä–∞–º. –î–µ–≤–æ—á–∫–∏ —á–∞—Å—Ç–æ –≥–æ–≤–æ—Ä—è—Ç, —á—Ç–æ –≤ –ò–Ω—Å—Ç–∞–≥—Ä–∞–º–µ —É –≤—Å–µ—Ö –≤—Å–µ —Ç–∞–∫ –∫—Ä—É—Ç–æ, —á—Ç–æ —ç—Ç–æ –∏—Ö —Å–º—É—â–∞–µ—Ç –∏ –æ–Ω–∏ —á—É–≤—Å—Ç–≤—É—é—Ç —Å–µ–±—è –Ω–µ—É–≤–µ—Ä–µ–Ω–Ω–æ. –ù—É –Ω–µ –∑–Ω–∞—é, —É –º–µ–Ω—è –≤ –ò–≥ –∏—Å–∫–ª—é—á–∏—Ç–µ–ª—å–Ω–æ –ø–æ–∑–∏—Ç–∏–≤–Ω—ã–π –æ–ø—ã—Ç. –ú–µ–Ω—è –æ—á–µ–Ω—å –≤–¥–æ—Ö–Ω–æ–≤–ª—è—é—Ç –∫—Ä–∞—Å–∏–≤—ã–µ –∫–∞—Ä—Ç–∏–Ω–∫–∏, –∫—Ä–∞—Å–∏–≤–∞—è –∂–∏–∑–Ω—å, –ª—é–¥–∏, –≤–µ—â–∏, –∏–¥–µ–∏, –º–µ—á—Ç—ã. –•–æ—á–µ—Ç—Å—è —Ä–∞–±–æ—Ç–∞—Ç—å –µ—â—ë –±–æ–ª—å—à–µ, —Å—Ç–∞—Ä–∞—Ç—å—Å—è —Å–æ —Å–≤–æ–∏–º–∏ —Å—Ç—Ä–∞—Ö–∞–º–∏ –µ—â—ë –±–æ–ª—å—à–µ, –µ—â—ë –±–æ–ª—å—à–µ –º–µ—á—Ç–∞—Ç—å. –£ –º–µ–Ω—è, –∫—Å—Ç–∞—Ç–∏, –ø–æ –∫–≤–∞–¥—Ä–∞—Ç—É –ü–∏—Ñ–∞–≥–æ—Ä–∞ —Å–µ–∫—Ç–æ—Ä –ª–æ–≥–∏–∫–∞ –ø—É—Å—Ç—É–µ—ÇüòÇ, —ç—Ç–æ –∑–Ω–∞—á–∏—Ç, —á—Ç–æ —è —á–µ–ª–æ–≤–µ–∫ —Å –±–µ–∑–≥—Ä–∞–Ω–∏—á–Ω–æ–π —Ñ–∞–Ω—Ç–∞–∑–∏–µ–π. –≠—Ç–æ –ø—Ä–∞–≤–¥–∞, —è —Ä–µ–∞–ª—å–Ω–æ –º–æ–≥—É –ø—Ä–æ—Å—Ç–æ –∂–∏—Ç—å –≤ –º–∏—Ä–µ, –∫–æ—Ç–æ—Ä—ã–π —É –º–µ–Ω—è –≤ –≥–æ–ª–æ–≤–µ. –≠—Ç–æ –º–æ–∂–µ—Ç –±—ã—Ç—å –æ–ø–∞—Å–Ω–æ, –µ—Å–ª–∏ –Ω–µ –Ω–∞—É—á–∏—Ç—å—Å—è –∑–∞–∑–µ–º–ª—è—Ç—å—Å—è, –º–æ–≥—É –ø—Ä–æ—Å—Ç–æ –æ—Ç—Å—É—Ç—Å—Ç–≤–æ–≤–∞—Ç—å –≤ —ç—Ç–æ–º –º–∏—Ä–µ –Ω–µ–¥–µ–ª—è–º–∏, —Ö–æ–¥–∏—Ç—å –ø–æ –≥–æ—Ä–æ–¥—É, —á—Ç–æ-—Ç–æ –¥–µ–ª–∞—Ç—å, –≥—É–ª—è—Ç—å, –Ω–æ –Ω–∞ —Å–∞–º–æ–º –¥–µ–ª–µ —è –Ω–µ —Ç—É—ÇüôÜüèΩ\u200d‚ôÄÔ∏è.',
